import React, { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";

interface iBook {
  id: string;
  name: string;
}

function App() {
  const [books, setBooks] = useState([] as Array<iBook>);

  useEffect(() => {
    axios
      .get("https://the-one-api.dev/v2/book")
      .then((res) => {
        setBooks(res.data.docs);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className="App">
      <ul>
        {books.map((book) => (
          <li key={book.id}>{book.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
